import * as React from "react"
import { Link } from "gatsby"
// import '../components/layout.css';
//import { StaticImage } from "gatsby-plugin-image";
//import Card from '../components/card';
import '../components/layout.css';
import styled from 'styled-components';
import Theme from '../theme';
import Header from '../components/header';
import Seo from "../components/seo";



const Wrapper = styled.div`
display: flex;
position: relative;
margin:0;
padding:0;
.logo {
  margin: 39vh auto;
  width: 216px;
  align-self:center;
  justify-self:center;
  mix-blend-mode: screen;
  path {
    fill: rgba(250,250,250,0.8);
  }
 @media(max-width: 1024px){
   width:200px;
   margin: 34vh auto;
 }
}

flex-direction: row;
 video {
  object-fit: cover;
  width: 100vw;
  height: 100vh;
  position: fixed;
  right:0;
  bottom:0;
  top: 0;
  left: 0;
  z-index:-1;
 }
 
`

const StyledSocialMedias = styled.div`
 display: flex;
 flex-direction: row;
 margin:0 auto;
 width: 36.56%;
 z-index:9999;
 justify-content: space-around;
 align-items: center;
 position: fixed;
 bottom:0.8rem;

 @media(max-width:1024px) {
   width:100%;
   align-self:center;
   justify-self:center;
 }

 #icon {
   width: 34px;
   height: 34px;
   margin:0 14px;
   align-self: flex-start;
   &:hover path {
    transition: all 0.2s ease-in;
     opacity: 0.8;
    }

   #yt {
      &:hover  {
        path {
        fill:#FF0000;
      }
    }
    }

    #insta {
      &:hover  {
        path {
        fill: #C13584;
        }
      }
    }

    #spt {
      &:hover {
        path {
        fill: #1DB954;
        }
      }
    }

    #fb {
      &:hover  {
        path {
        fill: #4267B2;
        }
      }
    }
  
 }
`

